    "contracts/asy/common/Admin.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "hardhat/console.sol";

contract Admin {
    error Only_owner_can_call_this_function();

    error Only_admin_can_call_this_function();

    address public owner;
    mapping(address => bool) public admins;

    constructor() {
        owner = msg.sender;
        admins[msg.sender] = true;
    }

    modifier onlyOwner() {
        if (msg.sender != owner) {
            revert Only_owner_can_call_this_function();
        }
        _;
    }

    modifier onlyAdmin() {
        if (!admins[msg.sender]) {
            revert Only_admin_can_call_this_function();
        }
        _;
    }

    function _initOwner(address _owner) internal {
        owner = _owner;
        admins[_owner] = true;
    }

    function addAdmin(address _admin) public onlyOwner {
        admins[_admin] = true;
    }

    function removeAdmin(address _admin) public onlyOwner {
        admins[_admin] = false;
    }

    function transferOwnership(address newOwner) public onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        address oldOwner = owner;
        owner = newOwner;
        admins[oldOwner] = false;
        admins[newOwner] = true;
    }
}
"
