    "contracts/asy/implemetion/Market.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "../common/Admin.sol";
import "../interface/IOracle.sol";
import "../interface/IPassport.sol";
import "../interface/ITicket.sol";

contract Market is Initializable, ReentrancyGuard, Admin {
    using SafeERC20 for IERC20;

    event BuyPassport(string userId, uint256 tokenId, uint256 showPrice, uint256 payPrice);

    event BuyTicket(string userId, uint256 tokenId, uint256 ticketType, uint256 ticketNum, uint256 showPrice, uint256 payPrice);

    error Invalid_slippage();

    error Invalid_address();

    error Invalid_ticket_config();

    error Invalid_ticket_type();

    error Insufficient_payment();

    error Invalid_level();

    error Passport_already_purchased();

    error Invalid_buy_num();

    error Invalid_fans_nft();

    error NFT_not_listed();

    error NFT_not_for_sale();

    IPassport public passport;
    ITicket public ticket;
    IOracle public oracle;
    address public receiverAddress;
    uint256 public slippage;
    uint256 public passportPrice;
    uint256 public passportShowPrice;
    mapping(uint256 => uint256) public ticketNums;
    mapping(uint256 => uint256) public ticketPrices;
    mapping(uint256 => uint256) public ticketShowPrices;

    IERC20 public usdc;

    constructor() {}

    function initialize(
        address _passport,
        address _ticket,
        address _oracle,
        address _receiverAddress,
        address _usdc,
        uint256 _slippage,
        uint256 _passportPrice,
        uint256 _passportShowPrice,
        uint256[] memory _ticketNums,
        uint256[] memory _ticketPrices,
        uint256[] memory _ticketShowPrices)
    public initializer {
        _initOwner(msg.sender);

        passport = IPassport(_passport);
        ticket = ITicket(_ticket);
        oracle = IOracle(_oracle);
        receiverAddress = _receiverAddress;
        usdc = IERC20(_usdc);
        slippage = _slippage;
        passportPrice = _passportPrice;
        passportShowPrice = _passportShowPrice;

        if (_ticketNums.length != _ticketPrices.length) {
            revert Invalid_ticket_config();
        }

        for (uint256 i=0; i<_ticketNums.length; i++) {
            ticketNums[i+1] = _ticketNums[i];
            ticketPrices[i+1] = _ticketPrices[i];
            ticketShowPrices[i+1] = _ticketShowPrices[i];
        }
    }

    function setOracle(address _oracle) public onlyAdmin {
        if (_oracle == address(0)) {
            revert Invalid_address();
        }
        oracle = IOracle(_oracle);
    }

    function setPassport(address _passport) public onlyAdmin {
        if (_passport == address(0)) {
            revert Invalid_address();
        }
        passport = IPassport(_passport);
    }

    function setTicket(address _ticket) public onlyAdmin {
        if (_ticket == address(0)) {
            revert Invalid_address();
        }
        ticket = ITicket(_ticket);
    }

    function setReceiverAddress(address _receiverAddress) public onlyAdmin {
        if (_receiverAddress == address(0)) {
            revert Invalid_address();
        }
        receiverAddress = _receiverAddress;
    }

    function setUSDC(address _usdc) public onlyAdmin {
        if (_usdc == address(0)) {
            revert Invalid_address();
        }
        usdc = IERC20(_usdc);
    }

    function setSlippage(uint256 _slippage) public onlyAdmin {
        if (_slippage > 10000) {
            revert Invalid_slippage();
        }

        slippage = _slippage;
    }

    function setPassportPrice(uint256 _passportPrice) public onlyAdmin {
        passportPrice = _passportPrice;
    }

    function setTicketPrice(uint256 _ticketType, uint256 _ticketNum, uint256 _ticketPrice) public onlyAdmin {
        ticketPrices[_ticketType] = _ticketPrice;
        ticketNums[_ticketType] = _ticketNum;
    }

    function setTicketNums(uint256[] memory _ticketNums) public onlyAdmin {
        for (uint256 i=0; i<_ticketNums.length; i++) {
            ticketNums[i+1] = _ticketNums[i];
        }
    }

    function buyPassport(address receiver, string memory userId) public payable nonReentrant{
        if (oracle.calculateUsdtAmount(msg.value) < passportPrice * (10000 - slippage) / 10000) {
            revert Insufficient_payment();
        }
        payable(receiverAddress).transfer(msg.value);

        _buyPassport(receiver, userId, msg.value);
    }

    function buyPassportByUSDC(address receiver, string memory userId, uint256 _passportPrice) public nonReentrant{
        if (_passportPrice < passportPrice) {
            revert Insufficient_payment();
        }
        usdc.transferFrom(msg.sender, receiverAddress, _passportPrice);

        _buyPassport(receiver, userId, _passportPrice);
    }

    function _buyPassport(address receiver, string memory userId, uint256 _passportPrice) private {
        if (passport.getTokenId(userId) != 0) {
            revert Passport_already_purchased();
        }

        uint256 tokenId = passport.mint(receiver, userId);

        emit BuyPassport(userId, tokenId, passportShowPrice, _passportPrice);
    }

    function buyTicket(address receiver, string memory userId, uint256 ticketType) public payable nonReentrant{
        if (oracle.calculateUsdtAmount(msg.value) < ticketPrices[ticketType] * (10000 - slippage) / 10000) {
            revert Insufficient_payment();
        }
        payable(receiverAddress).transfer(msg.value);

        _buyTicket(receiver, userId, ticketType, msg.value);
    }

    function buyTicketByUSDC(address receiver, string memory userId, uint256 ticketType, uint256 _ticketPrice) public nonReentrant{
        if (_ticketPrice < ticketPrices[ticketType]) {
            revert Insufficient_payment();
        }
        usdc.transferFrom(msg.sender, receiverAddress, _ticketPrice);

        _buyTicket(receiver, userId, ticketType, _ticketPrice);
    }

    function _buyTicket(address receiver, string memory userId, uint256 ticketType, uint256 _ticketPrice) private {
        if (ticketNums[ticketType] == 0 || ticketPrices[ticketType] == 0) {
            revert Invalid_ticket_type();
        }

        uint256 tokenId = ticket.mint(receiver, userId, ticketNums[ticketType]);

        emit BuyTicket(userId, tokenId, ticketType, ticketNums[ticketType], ticketShowPrices[ticketType], _ticketPrice);
    }
}
"
    },
